    let [note, setNote] = useState(null)

    useEffect(() => {

    })

    let getNote = async () => {
        fetch(`/api/notes/${noteId}/`)
    }

    return (
        <div>
            <h1>Single Note {noteId}</h1>
        </div>
    )
}

export default NotePage
